import { AppBar, Box, Button, IconButton, Menu, Toolbar, Typography } from "@mui/material";
import { useState } from "react";
import TempDrawer from "./TempDrawer";

const Navbar2 = () => {
    const [openDrawer, setOpenDrawer] = useState(false);
    const handleDrawerOpen = () => {
        setOpenDrawer(true);
    };
    return (
        <>
            <TempDrawer />
            <AppBar position="relative" sx={{ bgcolor: 'success.main' }}>
                <Toolbar sx={{ width: { xl: '76%', lg: '90%' }, margin: { xl: '0 auto', lg: '0 auto' }, justifyContent: 'space-between' }}>
                    <Typography variant="h5" noWrap>
                        Team Finder
                    </Typography>
                    <Box>
                    <Box sx={{ display: { xs: 'none', sm: 'block' } }}>
                        <Button>
                            Home
                        </Button>
                        <Button>
                            About
                        </Button>
                    </Box>
                    <IconButton 
                        sx={{ display: { xs: 'block', sm: 'none' } }}
                        onClick={handleDrawerOpen}
                    >
                        <Menu />
                    </IconButton>
                </Box>
                </Toolbar>
            </AppBar>
        </>
    )
};

export default Navbar2;
